import qs from "qs";
import axios from "axios";


const apiClient = axios.create({
    baseURL: "https//itunes.apple.com"
});

export const getMusics = (term) => {
    //検索するパラメーターを設定
    const params = {
        term,
        media: "music",
        entity: "musicTrack",
        country: "jp",
        lang: "ja_jp",
        limit: "50"
    };
    // baseURLに設定したparamsを使ってgetリクエストを送信
    return apiClient.get(`/search?${qs.stringify(params)}`);
}
